import ast

def filterDataUse(x):
    fields_keep =  ['ID', 'bathroom', 'bedroom', 'floor','creatorType','wideRoad']
    myDict = {}
    for key in fields_keep:
        try:
            myDict[key] = x[1][key]
        except:
            myDict[key] = None
    try:
        myDict["area_value"] = x[1]["area"]["value"]
    except:
        myDict["area_value"] = None
    try:
        myDict["price_m2"] = x[1]["price"]["m2"]
    except:
        myDict["price_m2"] = None
    try:
        myDict["location_district"] = x[1]["location"]["district"]
    except:
        myDict["location_district"] = None
    try:
        myDict["location_ward"] = x[1]["location"]["ward"]
    except:
        myDict["location_ward"] = None
    try:
        myDict["location_street"] = x[1]["location"]["street"]
    except:
        myDict["location_street"] = None
    try:
        myDict["feature"] = " ".join(map(str,x[1]["feature"])).replace(","," ").replace("_"," ").strip()
    except:
        myDict["feature"] = "khac"
    try:
        myDict["direction"] = " ".join(map(str,x[1]["direction"])).replace(","," ").replace("_"," ").strip()
    except:
        myDict["direction"] = "khac"
    try:
        myDict["legalPaper"] = " ".join(map(str,x[1]["legalPaper"])).replace(","," ").replace("_"," ").strip()
    except:
        myDict["legalPaper"] = "khac"
    try:
        myDict["geolocation_lat"] = ast.literal_eval(x[1]["geolocation"][0])
        myDict["geolocation_lon"] = ast.literal_eval(x[1]["geolocation"][1])
    except:
        myDict["geolocation_lat"] = None
        myDict["geolocation_lon"] = None
    return  myDict

